import React from "react";
import Typewriter from "typewriter-effect";
import "./home.css";
import { motion } from "framer-motion";
function home() {
  return (
    <div className="container1">
      <h1 id="intro1">Hello Everyone I am Anish Kumar Singh</h1>
      <p className="intro">
        I am a Second Year CSE Undergrad at BIT MESRA.I like to explore all
        domains and learn new stuffs. My Hobbies Include Playing Table Tennis
        and Volleyball
      </p>
      <div className="typer">
        <Typewriter
          onInit={(typewriter) => {
            typewriter
              .typeString("Learner")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Programmer")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Developer")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Data Structures Enthusiast")
              .pauseFor(2500)
              .deleteAll()
              .typeString("Developer")
              .pauseFor(2500)
              .deleteAll()
              .start();
          }}
        />
      </div>
    </div>
  );
}

export default home;
